   <b key="97d1704e-ef60-41e5-b723-86b5d2a55b08">
    Jennifer
   </b>
   is only appeared on
   <i key="a82ea908-63bf-4e4f-aac4-b019e29e60e4">

   </i>
   as one of
   The Backyard Gang
   's "new friends". She was played by
   Alexis Harris
   . She did not appear in the TV series and was replaced by a new character,
   <a href="Tosha.html" key="f94fa33b-c798-4e16-81b5-528a3ebf20f9" title="Tosha">
